webpackJsonp([3001484052944],{9100:function(t,e){t.exports={pathContext:{group:[{node:{fields:{title:"12 Hours to Confusion",date:"31 Dec 2001",slug:"/2001-12-31-12-hours-to-confusion/",tags:"Y2001"},html:'<p>Hi, we\'re back on European turf. We got to experience first hand the <a href="http://scriptingnews.userland.com/backissues/2001/12/30#lb80afadc2c02a67a0b715b010c14523f">confusion</a> at airports that Dave mentioned. Actually, except for my shoes going through the sprectrometer (without me in them), getting through security was no big deal. </p>\n<p>Gotta run, the German New Year\'s Eve tradition <a href="http://german.about.com/library/weekly/aa010101a.htm">Dinner for One</a> is about to come on TV...</p>'},next:{fields:{title:"Streptococci",date:"30 Dec 2001",slug:"/2001-12-30-streptococci/"}},previous:{fields:{title:"Happy E-Day",date:"01 Jan 2002",slug:"/2002-01-01-happy-e-day/"}}},{node:{fields:{title:"Streptococci",date:"30 Dec 2001",slug:"/2001-12-30-streptococci/",tags:"Y2001"},html:"<p>We're flying back to Hamburg today. Give us a couple of days to get over jet lag (and for Scott, a case of the Minnesota strep throat), and things might be back to normal.</p>"},next:{fields:{title:"Turning Two",date:"27 Dec 2001",slug:"/2001-12-27-turning-two/"}},previous:{fields:{title:"12 Hours to Confusion",date:"31 Dec 2001",slug:"/2001-12-31-12-hours-to-confusion/"}}},{node:{fields:{title:"Turning Two",date:"27 Dec 2001",slug:"/2001-12-27-turning-two/",tags:"Y2001"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/12/crhzwei.jpg" height="263" width="350" border="0" alt="crhzwei.jpg: " /></p>\n<p>Christopher turns two today (or zwei, depending on which language he happens to be using). His grandmother has a big turkey in the oven for him. Actually, he calls all birds ducks, so he thinks it\'s a duck. (And if you think that life with Christopher is something like a <a href="http://www.whyaduck.com/">Marx Brothers</a> movie, you\'re probably right.)</p>'},next:{fields:{title:"Everybody say Hey!",date:"25 Dec 2001",slug:"/2001-12-25-everybody-say-hey/"}},previous:{fields:{title:"Streptococci",date:"30 Dec 2001",slug:"/2001-12-30-streptococci/"}}}],pathPrefix:"",first:!1,last:!1,index:954,pageCount:1101}}}});
